function App() {


  const fetchData = async()=>{

     const url = 'https://api.openweathermap.org/data/2.5/weather?q=pune&appid=2d4a63ea0bfee20697bf482725ccf5b0';
     const data = await fetch(url);
     const result = await data.json();
     console.log(result);
  }
  fetchData();




  return (
    <>

    <p>Enter your location</p>
    <div  style='width:500px;margin:auto'>
     <input className="container col-md-6 col-lg-6" type="search" placeholder="Search" aria-label="Search" />    
    </div>
     </>
  );
}

export default App;
